function getIconEntidade(mode){
    var return_ = false;
    if (window.location.host.indexOf('.prf.gov.br') !== -1) {
        return_ = (mode == 'black') 
                ? 'data:image/svg+xml;base64,'
                : 'data:image/svg+xml;base64,';
    }
    return return_;
}
function loadIconEntidade() {
    if ($('.infraTituloLogoSistema').length > 0 && $('#iconEntidade').length == 0) {
        var base64Icon = getIconEntidade('white');
        if (base64Icon) {
            var iconEntidade = '<img style="height: 35px;" id="iconEntidade" src="'+base64Icon+'">';
            $('.infraTituloLogoSistema').after(iconEntidade);
            $('#divInfraBarraSistemaE').css({'position':'absolute', 'width': '30%'});
        }
    } else if ($('#divAreaRestrita').length > 0 && $('#iconEntidade').length == 0) {
        var base64Icon = getIconEntidade('black');
        if (base64Icon) {
            var iconEntidade = '<img style="height: 45px;margin-top: 30px;" id="iconEntidade" src="'+base64Icon+'">';
            $('#divAreaRestrita').append(iconEntidade).css('overflow', 'initial');
        }
    }
}
function initIconEntidade(TimeOut = 9000) {
    if (TimeOut <= 0 || parent.window.name != '') { return; }
    if (typeof getConfigHost === 'function' && typeof $ === 'function') {
        if (sessionStorage.getItem('configHost_Pro') !== null) {
            setConfigHost(JSON.parse(sessionStorage.getItem('configHost_Pro')), loadIconEntidade);
        } else {
            getConfigHost(loadIconEntidade);
        }
    } else {
        setTimeout(function(){ 
            initIconEntidade(TimeOut - 100); 
            console.log('Reload initIconEntidade => '+TimeOut); 
        }, 500);
    }
}
